import React, { Component } from "react";
import { Link, animateScroll as scroll } from "react-scroll";


class MainHeader extends Component {
  render(

  ) {
    return (
      <nav className="navbar navbar-expand-lg custom-nav fixed-top sticky">
        <a className="smoothscroll navbar-brand" href="#home" onClick={scroll.scrollToTop}>
          <Link 
          // activeClass="active"
            to="home"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          > Jae Kim </Link>
        </a>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <i className="fa fa-bars"></i>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav ml-auto">
            <li className="nav-item active">
              <a href="#about" className="active nav-link" onClick={scroll.scrollToTop}>
                <Link 
                // activeClass="active"
                  to="home"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                > Home </Link>
              </a>
            </li>
            <li className="nav-item">
              <a className="active nav-link" href="#about">
                <Link 
                activeClass="active"
                  to="about"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                > About </Link>
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#blog">
                <Link 
                activeClass="active"
                  to="blog"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                > Blog </Link>
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#work" >
                <Link 
                activeClass="active"
                  to="work"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                > Projects </Link>
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#contact">
                <Link 
                activeClass="active"
                  to="contact"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                > Contact </Link>
              </a>
            </li>
          </ul>
        </div>
      </nav>
    );
  }
}
export default MainHeader;
